	return (
		<div className='header'>
      <img src={Logo2} alt='logo' width="500" height="100" />
			<div className='logo'>
				<h1 className='logocolor'>CAR<img src={Logo} alt='logo' /></h1>
			</div>

		</div>
	);
};
export default Header;
